export function endpoint() {
    return(
        fetch('http://makeup-api.herokuapp.com/api/v1/products.json?brand=maybelline')
        .then(res => res.json())
        .then((out) => {
            console.log(out);
        }).catch(err => console.error(err))
    )
}
